import React, {useState, useEffect} from "react";
import axios from "axios";
const Search_vehicule = () => {
    const [immatriculation, setimmatriculation] = useState([]);
    const [loadingR, setLoadingR] = useState(false);
    let token = `Bearer ${localStorage.getItem("token")}`;

    useEffect(() => {
        const sites = JSON.parse(localStorage.getItem("site"))
        if (sites != "") {
            sites.map((sit) => {
                axios.get(`http://localhost:5000/api/vehicule/${sit.idSite}`,
                    {
                        headers: {
                            Accept: 'application/json',
                            'Content-Type': 'application/json',
                            Authorization: token
                        }
                    }
                ).then((response) => {
                    setLoadingR(true);
                    setimmatriculation(response.data.data);
                    setLoadingR(false);
                }).catch((error) => {

                })
            })
        }
    }, [])
    return (
        <>
            <div className="card">
                <div className="card-body">
                    <div className="row">
                        <div className="col-md-3">
                            <label htmlFor="">Periode</label>
                            <input type="date" className="form-control" placeholder="text debut" /><br />
                            <input type="date" className="form-control" placeholder="text debut" />
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Immatriculation</label>
                            <select name="" id="" className="form-control">
                                {
                                    immatriculation.map((imm) => {
                                        return (
                                            <option>{imm.immatriculation}</option>
                                        )
                                    })
                                }
                                <option value="">.</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Numero BC</label>
                            <input type="text" className="form-control" placeholder="text fin" />
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Chauffeur</label>
                            <select name="" id="" className="form-control">
                                <option value="">...</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Marque</label>
                            <select name="" id="" className="form-control">
                                <option value="">...</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Model</label>
                            <input type="text" className="form-control" placeholder="text fin" />
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Province</label>
                            <select name="" id="" className="form-control">
                                <option value="">...</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Ville</label>
                            <select name="" id="" className="form-control">
                                <option value="">...</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Quantite</label>
                            <input type="text" className="form-control" placeholder="text fin" />
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Carburant</label>
                            <input type="text" className="form-control" placeholder="text fin" />
                        </div>
                        <div className="col-md-3">
                            <label htmlFor="">Site</label>
                            <select name="" id="" className="form-control">
                                <option value="">...</option>
                            </select>
                        </div>
                        <div className="col-md-3">
                            <br />
                            <button className="btn btn-primary"> <i className="fas fa-search"></i></button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Search_vehicule;
